function resetAddAddressButton(){
	if(!document.getElementById("addAddress") && document.getElementById("printEti")){
		addAddress = document.createElement("button");
		initAddressButton(addAddress);
		document.getElementById("printEti").parentNode.insertBefore(addAddress,document.getElementById("printEti"));
		document.getElementById("printEti").parentNode.removeChild(document.getElementById("printEti"));
	} else {
		addAddress.title = "";
	}
}

function updatePrintButton(etykiety){
	if(document.getElementById("printEti")) {
		printEti = document.getElementById("printEti");
		printEti.innerHTML = "Drukuj ("+(etykiety.length)+")";
	}
}


