function fixFarmerData(){
	if(document.getElementById("FirstName")) {
		document.getElementById("FirstName").value = document.getElementById("FirstName").value.replace(/[^a-zęóąśłżźćń ]/gi, "").trim().capitalize();
		if(/a$/i.test(document.getElementById("FirstName").value)) document.getElementById("Sex").value = "Female";
	}
	if(document.getElementById("LastName")) document.getElementById("LastName").value = document.getElementById("LastName").value.replace(/[^a-zęóąśłżźćń \-]/gi, "").trim().capitalize();
	if(lokacja.indexOf('Customer/Farmers/EditAdmin/')!=-1){ //Nie dotyczy punktów sprzedaży
		if(/GUID[0-9]+/i.test(document.getElementById("FarmName").value) || !/[a-z]/i.test(document.getElementById("FarmName").value)) document.getElementById("FarmName").value = "Gospodarstwo Rolne";
		else document.getElementById("FarmName").value = document.getElementById("FarmName").value.replace(/^G(\.)?R(\.)?$/i, "Gospodarstwo Rolne").trim().capitalize();
		document.getElementById("NIP").value = document.getElementById("NIP").value.replace(/\D+/g, "");
		document.getElementById("PESEL").value = document.getElementById("PESEL").value.replace(/\D+/g, "");
	}
	if(/GUID[0-9]+/i.test(document.getElementById("HouseNumber").value) || !/[0-9]/.test(document.getElementById("HouseNumber").value)) {
		document.getElementById("HouseNumber").value = "";
	}
	if(!/^\d+[a-z]?(\/\d+)?$/i.test(document.getElementById("HouseNumber").value)) {
		console.log("1");
		if(/\d+\s*(\/)?\s*[a-z]?\s*(\/\s*\d+)?\s*$/i.test(document.getElementById("Street").value)){
			document.getElementById("HouseNumber").value = /\d+\s*(\/)?\s*[a-z]?\s*(\/\s*\d+)?\s*$/i.exec(document.getElementById("Street").value.trim())[0].replace(/\s+/g, "").replace(/(\d+)\s*(\/)\s*([a-z])/i, "$1$3");
		} else if(/\d+\s*(\/)?\s*[a-z]?\s*(\/\s*\d+)?\s*$/i.test(document.getElementById("City").value)){
			document.getElementById("HouseNumber").value = /\d+\s*(\/)?\s*[a-z]?\s*(\/\s*\d+)?\s*$/i.exec(document.getElementById("City").value.trim())[0].replace(/\s+/g, "").replace(/(\d+)\s*(\/)\s*([a-z])/i, "$1$3");
		} else {
			console.log("1");
			var HouseNumber = /\d+\s*(\/)?\s*[a-z]?\s*(\/\s*\d+)?/i.exec(document.getElementById("HouseNumber").value.trim())
			document.getElementById("HouseNumber").value = (HouseNumber)?HouseNumber[0].replace(/\s+/g, "").replace(/(\d+)\s*(\/)\s*([a-z])/i, "$1$3"):document.getElementById("HouseNumber").value.replace(/(\D|\/)+/g, "");
		}
	}
	document.getElementById("HouseNumber").value = document.getElementById("HouseNumber").value.replace(/(^\/+|\/+$)/g, "").trim().toUpperCase();
	if(!/[a-zęóąśłżźćń]/i.test(document.getElementById("Street").value)) document.getElementById("Street").value = "";
	else document.getElementById("Street").value = document.getElementById("Street").value.replace(/\d+\s*(\/)?\s*[a-z]?\s*(\/\s*\d+)?\s*$/i, "").trim().capitalize();
	if(/GUID[0-9]+/i.test(document.getElementById("City").value) || !/[a-z]/i.test(document.getElementById("City").value)) {
		document.getElementById("City").value = document.getElementById("Street").value;
		document.getElementById("Street").value = "";
	} else {
		document.getElementById("City").value = document.getElementById("City").value.replace(/\d+\s*(\/)?\s*[a-z]?\s*(\/\s*\d+)?\s*$/i, "").trim().capitalize();
	}
	document.getElementById("Zip").value = document.getElementById("Zip").value.replace(/\D+/g, "").replace(/^(\d{2})(\d{3})$/, "$1-$2");
	if(document.getElementById("Street").value == document.getElementById("City").value) document.getElementById("Street").value = "";
	if(/GUID[0-9]+/i.test(document.getElementById("Post").value) || !/[a-z]/i.test(document.getElementById("Post").value)) document.getElementById("Post").value = document.getElementById("City").value;
	else document.getElementById("Post").value = document.getElementById("Post").value.trim().capitalize();
	if(/GUID[0-9]+/i.test(document.getElementById("Municipality").value) || !/[a-z]/i.test(document.getElementById("Municipality").value)) document.getElementById("Municipality").value = document.getElementById("Post").value;
	else document.getElementById("Municipality").value = document.getElementById("Municipality").value.trim().capitalize();
	document.getElementById("PhoneNumber").value = document.getElementById("PhoneNumber").value.replace(/\D+/g, "").replace(/^(\d*?)(\d{2})(\d{3})(\d{2})(\d{2})$/, function(m,p1,p2,p3,p4,p5){return ((p1.length>0 && p1!="0")?p1:"0048")+" "+p2+" "+p3+" "+p4+" "+p5;});
	document.getElementById("MobilePhoneNumber").value = document.getElementById("MobilePhoneNumber").value.replace(/\D+/g, "").replace(/^(\d*?)(\d{3})(\d{3})(\d{3})$/, function(m,p1,p2,p3,p4){return ((p1.length>0 && p1!="0")?"+"+p1:"+48")+" "+p2+"-"+p3+"-"+p4;});
	if(/@/.test(document.getElementById("Email").value)) document.getElementById("Email").value = document.getElementById("Email").value.trim().toLowerCase();
	else document.getElementById("Email").value = "";
}

